import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Navigation from './components/navigation'

function App() {
  return (  


    <div className="App">

      <Navigation />



      <header className="App-header">
      <div class="container">
          <h3 class="display-1" headerTitleStyle>Welcome to Nursing Toolkit</h3>
          <p></p><p></p>
          <p>This site was created by me to save nurses precious time by automating tasks where possible. </p>
      </div>        
      </header>
    </div>



  );
}

export default App;
